import './Kitap.css';
class KitapOzetleri2 extends Component {
    render() {
        return (
            <div className='KitapOzetleri2'>
        <p> Kitap ozetleri bu kısımda yer alacak.</p>
      </div>
        )
    }
}
export default KitapOzetleri2;
